path_to_string(Path) ->
    try
        case (erlang:length(Path) == 0) of
        true -> throw({return, "[]"});
        _ -> ok
    end,
        First = parse_key((case erlang:is_map(Path) of true -> maps:get(0, Path, nil); _ -> case 0 < 0 of true -> lists:nth(erlang:length(Path) + 0 + 1, Path); _ -> lists:nth(0 + 1, Path) end end)),
        S_2 = (((("[(" ++ mochi_str((case erlang:is_map(First) of true -> maps:get(0, First, nil); _ -> case 0 < 0 of true -> lists:nth(erlang:length(First) + 0 + 1, First); _ -> lists:nth(0 + 1, First) end end))) ++ ", ") ++ mochi_str((case erlang:is_map(First) of true -> maps:get(1, First, nil); _ -> case 1 < 0 of true -> lists:nth(erlang:length(First) + 1 + 1, First); _ -> lists:nth(1 + 1, First) end end))) ++ ")"),
        I_11 = 1,
        Fun_16 = fun Fun_16_loop(First, I_11, Path, S_2) ->
    case (I_11 < erlang:length(Path)) of
        true ->
            C_2 = parse_key((case erlang:is_map(Path) of true -> maps:get(I_11, Path, nil); _ -> case I_11 < 0 of true -> lists:nth(erlang:length(Path) + I_11 + 1, Path); _ -> lists:nth(I_11 + 1, Path) end end)),
            S_3 = (((((S_2 ++ ", (") ++ mochi_str((case erlang:is_map(C_2) of true -> maps:get(0, C_2, nil); _ -> case 0 < 0 of true -> lists:nth(erlang:length(C_2) + 0 + 1, C_2); _ -> lists:nth(0 + 1, C_2) end end))) ++ ", ") ++ mochi_str((case erlang:is_map(C_2) of true -> maps:get(1, C_2, nil); _ -> case 1 < 0 of true -> lists:nth(erlang:length(C_2) + 1 + 1, C_2); _ -> lists:nth(1 + 1, C_2) end end))) ++ ")"),
            I_12 = (I_11 + 1),
            Fun_16_loop(First, I_12, Path, S_3);
        _ -> {First, I_11, Path, S_2}
    end
end,
